import React from 'react';

const CricketBallIcon = () => {
  return (
    <svg
      xmlns="http://www.w3.org/2000/svg"
      width="24"
      height="24"
      viewBox="0 0 24 24"
      fill="none"
      stroke="currentColor"
      strokeWidth="2"
      strokeLinecap="round"
      strokeLinejoin="round"
      className="cricket-ball-icon"
    >
      {/* Outer circle representing the cricket ball */}
      <circle cx="12" cy="12" r="10" fill="red" />
      
      {/* Horizontal seam */}
      <path
        d="M4 12c4 4 8 4 12 0"
        stroke="white"
        strokeWidth="1"
      />

      {/* Two additional seams to represent the stitched threads */}
      <path
        d="M4 10c4 4 8 4 12 0M4 14c4 4 8 4 12 0"
        stroke="white"
        strokeWidth="1"
      />
    </svg>
  );
};

export default CricketBallIcon;
